import React from "react";
import { useNavigate } from "react-router-dom";
import "./index.css";

export default function BurnoutSurvey() {
  const navigate = useNavigate();

  const labels = [
    "Ï†ÑÌòÄÏóÜÎã§",
    "1ÎÖÑÏóê 2-3Ìöå ÎòêÎäî Í∑∏ ÎØ∏Îßå",
    "Ìïú Îã¨Ïóê Ìïú Î≤à ÎòêÎäî Í∑∏ ÎØ∏Îßå",
    "Ìïú Îã¨Ïóê 2-3Ìöå",
    "ÏùºÏ£ºÏùºÏóê 1Ìöå Ï†ïÎèÑ",
    "ÏùºÏ£ºÏùºÏóê 2-3Ìöå",
    "Îß§Ïùº"
  ];

  const questions = [
    "Îß°ÏùÄ ÏùºÏùÑ ÌïòÎäî Îç∞ ÏûàÏñ¥ÏÑú Ï†ïÏÑúÏ†ÅÏúºÎ°ú Í≥†Í∞àÎêú ÎäêÎÇåÏù¥ Îì†Îã§.",
    "ÏùºÏùÑ ÎßàÏπòÍ≥† Ìá¥Í∑ºÌï† ÎïåÏØ§Ïù¥Î©¥ Í∏∞ÏßÑÎß•ÏßÑÌïú ÎäêÎÇåÏù¥ Îì†Îã§.",
    "ÏïÑÏπ®Ïóê ÏùºÏñ¥ÎÇòÏÑú Îã§Ïãú Ï∂úÍ∑ºÌï† ÏÉùÍ∞ÅÏùÑ ÌïòÎ©¥ ÌîºÍ≥§Ìïú ÎäêÎÇåÏù¥ Îì†Îã§.",
    "ÎåÄÏÉÅÏûêÏùò Í∞êÏ†ïÏùÑ ÏâΩÍ≤å Ïù¥Ìï¥Ìï† Ïàò ÏûàÎã§.",
    "ÏùºÎ∂Ä ÎåÄÏÉÅÏûêÎì§Ïóê ÎåÄÌï¥ÏÑú Ïù∏Í≤©Ïù¥ ÏóÜÎäî Î¨ºÏ≤¥Ï≤òÎüº ÎåÄÌïòÍ≥† ÏûàÎã§Í≥† ÎäêÎÇÄÎã§.",
    "ÌïòÎ£® Ï¢ÖÏùº ÏÇ¨ÎûåÎì§Í≥º Ìï®Íªò ÏùºÌïúÎã§Îäî Í≤ÉÏùÄ ÌûòÎì† ÏùºÏù¥Îã§.",
    "ÎåÄÏÉÅÏûêÎì§Ïùò Î¨∏Ï†úÎ•º Ìö®Í≥ºÏ†ÅÏúºÎ°ú Ìï¥Í≤∞ÌïúÎã§.",
    "Ïùº ÎïåÎ¨∏Ïóê ÏÜåÏßÑÎêú ÏÉÅÌÉúÏù¥Îã§.",
    "ÏùºÏùÑ ÌÜµÌï¥ Îã§Î•∏ ÏÇ¨ÎûåÎì§Ïùò ÏÇ∂Ïóê Í∏çÏ†ïÏ†ÅÏù∏ ÏòÅÌñ•ÏùÑ Ï£ºÍ≥† ÏûàÎã§Í≥† ÎäêÎÇÄÎã§.",
    "Ïù¥ ÏóÖÎ¨¥Î•º ÌïòÍ≤åÎêú Ïù¥ÌõÑÎ°ú ÏÇ¨ÎûåÎì§ÏóêÍ≤å Ï†êÏ†ê ÎëîÍ∞êÌï¥Ï°åÎã§.",
    "Ïù¥ ÏßÅÏóÖÏúºÎ°ú Ïù∏Ìï¥ ÎÇ¥Í∞Ä Ï†ïÏÑúÏ†ÅÏúºÎ°ú Î©îÎßêÎùºÍ∞ÄÎäî Í≤É Í∞ôÏïÑ Í±±Ï†ïÏù¥Îã§.",
    "Îß§Ïö∞ ÌôúÍ∏∞Ï∞¨ ÎäêÎÇåÏù¥ Îì†Îã§.",
    "ÏóÖÎ¨¥Î°ú Ïù∏Ìï¥ Ï¢åÏ†àÍ∞êÏùÑ ÎäêÎÇÄÎã§.",
    "ÎÇ¥Í≤å Ï£ºÏñ¥ÏßÑ ÏùºÏùÑ ÏßÄÎÇòÏπòÍ≤å Ïó¥Ïã¨Ìûà ÌïúÎã§Í≥† ÎäêÎÇÄÎã§.",
    "Ïñ¥Îñ§ ÎåÄÏÉÅÏûêÎì§ÏóêÍ≤åÎäî Î¨¥Ïä® ÏùºÏù¥ ÏùºÏñ¥ÎÇ¨ÎäîÏßÄ Î≥ÑÎ°ú Ïã†Í≤Ω Ïì∞ÏßÄ ÏïäÎäîÎã§.",
    "ÏÇ¨ÎûåÎì§Í≥º ÏßÅÏ†ë ÎåÄÌïòÎ©¥ÏÑú ÏùºÌïòÎäî Í≤ÉÏóê Ïä§Ìä∏Î†àÏä§Î•º Î∞õÎäîÎã§.",
    "ÎåÄÏÉÅÏûêÎì§Í≥º ÏâΩÍ≤å Ìé∏ÏïàÌïú Î∂ÑÏúÑÍ∏∞Î•º ÎßåÎì§ Ïàò ÏûàÎã§.",
    "ÎåÄÏÉÅÏûêÎì§Í≥º ÏπúÎ∞ÄÌïòÍ≤å ÏùºÌïòÍ≥† ÎÇòÎ©¥ ÌùêÎ≠áÌï¥ÏßÑÎã§.",
    "ÏßÅÏóÖÏùÑ ÌÜµÌï¥ Í∞ÄÏπò ÏûàÎäî ÎßéÏùÄ Í≤ÉÎì§ÏùÑ ÏÑ±Ï∑®Ìï¥ÏôîÎã§.",
    "ÌïúÍ≥ÑÏóê Îã§Îã§Î•∏ ÎäêÎÇåÏù¥ Îì†Îã§.",
    "ÏßÅÏû•ÏóêÏÑú Í∞êÏ†ïÏ†ÅÏù∏ Î¨∏Ï†úÎì§ÏùÑ Îß§Ïö∞ Ïπ®Ï∞©ÌïòÍ≤å Îã§Î£¨Îã§.",
    "ÎåÄÏÉÅÏûêÎì§Ïù¥ Ïñ¥Îñ® ÎïåÎäî ÏûêÏã†Îì§Ïùò Î¨∏Ï†úÎì§Ïóê ÎåÄÌï¥ ÎÇòÎ•º ÎπÑÎÇúÌïòÍ≥† ÏûàÎã§Í≥† ÎäêÎÇÄÎã§."
  ];

  const handleSubmit = () => {
    const unanswered = questions.some((_, i) => {
      return !document.querySelector(`input[name='q${i}']:checked`);
    });

    if (unanswered) {
      alert("Î™®Îì† Î¨∏Ìï≠Ïóê ÏùëÎãµÌï¥Ïïº Í≤∞Í≥ºÎ•º Î≥º Ïàò ÏûàÏäµÎãàÎã§.");
      return;
    }

    const getValue = (i) => {
      const selected = document.querySelector(`input[name='q${i}']:checked`);
      return selected ? parseInt(selected.value, 10) : 0;
    };

    const exhaustionIdx = [0, 1, 2, 5, 7, 12, 13, 15, 19]; // Ï†ïÏÑúÏ†Å Í≥†Í∞à
    const depersonalIdx = [4, 9, 10, 14, 21];              // ÎπÑÏù∏Í≤©Ìôî
    const efficacyIdx = [3, 6, 8, 11, 16, 17, 18, 20];      // Í∞úÏù∏ ÏÑ±Ï∑®Í∞ê (Ïó≠Ï±ÑÏ†ê ÏïÑÎãò)

    const exhaustionSum = exhaustionIdx.reduce((sum, i) => sum + getValue(i), 0);
    const depersonalSum = depersonalIdx.reduce((sum, i) => sum + getValue(i), 0);
    const efficacySum = efficacyIdx.reduce((sum, i) => sum + getValue(i), 0);

    const exhaustionMean = exhaustionSum / exhaustionIdx.length;
    const depersonalMean = depersonalSum / depersonalIdx.length;
    const efficacyMean = efficacySum / efficacyIdx.length;

    const exhaustionT = 50 + 10 * (exhaustionSum - 21.42) / 11.5;
    const depersonalT = 50 + 10 * (depersonalSum - 8.11) / 6.15;
    const efficacyT = 50 + 10 * (efficacySum - 36.43) / 7.00;

    navigate("/result", {
      state: {
        exhaustionSum,
        exhaustionMean,
        depersonalSum,
        depersonalMean,
        efficacySum,
        efficacyMean,
        exhaustionT,
        depersonalT,
        efficacyT
      }
    });
  };  

  return (
    <div className="burnout-container">
      <main className="burnout-main">
        <section className="burnout-section">
          <h2 className="burnout-title">üìã MBI HSS ÏÑ§Î¨∏ÏßÄ</h2>
          <p className="burnout-instruction">
            Îã§Ïùå ÏßàÎ¨∏Ïóê 0ÏóêÏÑú 6 ÏÇ¨Ïù¥Ïùò Ï†êÏàòÎ°ú ÎãµÌï¥Ï£ºÏÑ∏Ïöî.<br />
            (0: Ï†ÑÌòÄÏóÜÎã§, 1: 1ÎÖÑÏóê 2-3Ìöå ÎòêÎäî Í∑∏ ÎØ∏Îßå, 2: Ìïú Îã¨Ïóê Ìïú Î≤à ÎòêÎäî Í∑∏ ÎØ∏Îßå,
            3: Ìïú Îã¨Ïóê 2-3Ìöå, 4: ÏùºÏ£ºÏùºÏóê 1Ìöå Ï†ïÎèÑ, 5: ÏùºÏ£ºÏùºÏóê 2-3Ìöå, 6: Îß§Ïùº)
          </p>
          {questions.map((q, idx) => (
            <div key={idx} className="burnout-question-card">
              <h3>{idx + 1}. {q}</h3>
              <div className="burnout-options">
                {labels.map((label, i) => (
                  <label key={i} className="burnout-option">
                    <input type="radio" name={`q${idx}`} value={i} />
                    {i} - {label}
                  </label>
                ))}
              </div>
            </div>
          ))}
          <div className="burnout-button-center">
            <button className="burnout-button" onClick={handleSubmit}>Í≤∞Í≥º Î≥¥Í∏∞</button>
          </div>
        </section>
      </main>
    </div>
  );
}
